import React from 'react';
import './share.css'
import News from "../news/News";
import Slider from "../Slider/Slider";
import {Posts} from "./Date.js"
function Share(){
    return(
        <div className="share">
            <div className="share-wrapper">
                <News/>
                <Slider/>
            </div>
        </div>
    )
}
export default Share;
